import React, { Component } from 'react';
import AlarmInfo from './AlarmInfo1';

class AlarmInfoList extends Component {
  static defaultProps = {
    data: []
  }

  render() {
    const { data } = this.props;

    return (
      <div>
        {this.props.data.map(
            <AlarmInfo key={data.id} info={data}/>
        )}
      </div>
    );
  }
}

export default AlarmInfoList;
